(17, 15, 'A306', NULL, 'A300B4-600 /C4-600 / F4-600', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Airbus'),
(18, 15, 'A30B', NULL, 'A300B2 / B4 / C4 / F4', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Airbus'),
(19, 15, 'A310', NULL, 'A310 / CC-150 Polaris', 'Der Airbus A310 ist ein zweistrahliges Großraumflugzeug des europäischen Flugzeugherstellers Airbus. Es handelt sich um eine für Mittel- und Langstreckenflüge konzipierte, verkürzte und weiterentwickelte Variante des Airbus A300. Es wurden von 1983 bis zum Ende der Produktion 2007 insgesamt 255 Airbus A310 in den Passagier- und Frachtversionen bestellt und ausgeliefert.', 71840, 220, 860, 9600, '12500', NULL, 20, 'H', '/images/aircraft/A310.jpg', 'Airbus'),
(20, 15, 'A318', NULL, 'A318', 'Der Airbus A318 ist der kleinste Airbus, der bis heute geflogen ist. Er ist speziell als Kurzstreckenverkehrsflugzeug geplant worden.', 34500, 107, 900, 6000, '12000', NULL, 26, 'M', '/images/aircraft/A318.jpg', 'Airbus'),
(21, 15, 'A319', NULL, 'A319', 'Mit einer Länge von 33.8 Metern gehört der A319 zu den kleinsten der Airbus-Familie. Dieses Flugzeug bietet auf den Strecken bis 3000 Kilometern ein Volumen von 108 bis 138 Sitzplätzen. Die zwei Triebwerke CFM56 verhelfen dem Airbus A319 zu einer Durchschnittsgeschwindigkeit von 750 Stundenkilometern. Flugzeuge dieses Typs fliegen auf den Flügen in Europa sowie zwischen der Schweiz, Afrika und Nahost. Ihr Durchschnittsalter beträgt neun Jahre.\r\n', 35400, 108, 850, 3000, NULL, NULL, 60, 'M', '/images/aircraft/A319.jpg', 'Airbus'),
(22, 15, 'A320', NULL, 'A320', 'Für Reichweiten bis zu 3600 Kilometern steht bei SWISS der Airbus A320 mit 136 bis 168 Sitzplätzen im Einsatz. Die CFM56-Triebwerke zeigen Umweltverhalten auf dem neuesten Stand. Das 37.6 Meter lange Flugzeug transportiert bis zu 3 Tonnen Fracht. Flugzeuge dieses Typs fliegen auf den Flügen in Europa sowie zwischen der Schweiz, Afrika und Nahost. Im Durchschnitt sind diese Flugzeuge acht Jahre jung.', 37230, 136, 850, 3650, NULL, NULL, 64, 'M', '/images/aircraft/A320.jpg', 'Airbus'),
(23, 15, 'A321', NULL, 'A321', 'Kurz- und Mittelstrecken mit einem höheren Passagieraufkommen bedient mit dem Airbus A321 mit 176 bis 200 Sitzplätzen und einer Fracht-Kapazität von 4.3 Tonnen. Mit einer Länge von 44.5 Metern ist der Airbus A321 der „grosse Bruder“ der A320-Familie und um ein Drittel länger als der Airbus A319. Flugzeuge dieses Typs fliegen auf den Flügen in Europa sowie zwischen der Schweiz, Afrika und Nahost. Das Durchschnittsalter dieser Flugzeuge beträgt neun Jahre. ', 47500, 176, 850, 3200, NULL, NULL, 68, 'M', '/images/aircraft/A321.jpg', 'Airbus'),
(24, 15, 'A332', NULL, 'A330-200', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Airbus'),
(25, 15, 'A333', NULL, 'A330-300', 'Diese Flugzeuge mit einer Kapazität von 236 Passagieren operieren mit der Konfiguration 8 First Class, 45 Business Class und 183 Economy Class Sitze. Der Antrieb erfolgt über zwei Rolls Royce 772B-EP (Enhanced Performance) Motoren. \r\n', 173000, 236, 880, 8400, NULL, 8, 45, 'H', '/images/aircraft/A330.jpg', 'Airbus'),
(26, 15, 'A342', NULL, 'A340-200', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Airbus'),
(27, 15, 'A343', NULL, 'A340-300', 'Der A340 ist der eigentliche "Marathonläufer" von Airbus und hält mehrere Langstreckenrekorde. Die attraktiven sogenannten Winglets an den Flügelspitzen verleihen dem Flugzeug eine elegante Erscheinung. Mehr noch: Die Winglets helfen, Kerosin zu sparen, indem sie die Vibrationen über dem Flügel drastisch reduzieren.', 181000, 219, 900, 10500, NULL, 8, 47, 'H', '/images/aircraft/A340.jpg', 'Airbus'),
(28, 15, 'A345', NULL, 'A340-500', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Airbus'),
(29, 15, 'A346', NULL, 'A340-600', 'Der Airbus A340 ist ein vierstrahliges Großraumflugzeug des europäischen Flugzeugherstellers Airbus. Der Erstflug dieses Langstreckenflugzeugs fand am 25. Oktober 1991 in der Version A340-300 statt. Der Tiefdecker war das erste Verkehrsflugzeug von Airbus mit vier Triebwerken und das erste zivile Großraumflugzeug weltweit mit digitaler Fly-by-Wire-Steuerung. Der Airbus A340 wurde parallel mit dem Schwestertyp Airbus A330 entwickelt, mit dem er viele Merkmale und Baugruppen gemeinsam hat.', 240000, 306, 915, 15000, '12500', 8, 60, 'H', '/images/aircraft/A340-600.jpg', 'Airbus'),
(30, 69, 'A37', NULL, '318 / A-37 Dragonfly', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'L', NULL, 'Cessna'),
(31, 15, 'A388', NULL, 'A380-800', 'Der Airbus A380 (umgangssprachlich auch Superjumbo als Steigerung von Jumbo-Jet, Airbus-interner Projektname Megaliner) ist ein vierstrahliges Großraumflugzeug des europäischen Flugzeugherstellers Airbus S. A. S. mit zwei durchgängigen Passagierdecks. Der Tiefdecker ist das größte zivile Verkehrsflugzeug, das bisher in Serienfertigung produziert wurde. Während der Konzeptionsphase wurde das Flugzeug als Airbus A3XX bezeichnet. Die Endmontage des Flugzeugs findet in Toulouse und die Kabinenausrüstung in Hamburg-Finkenwerder statt. Der Erstflug dieses Langstreckenflugzeugs wurde am 27. April 2005 mit einer Maschine mit der Werksseriennummer MSN001 in der Version A380-841 absolviert. Bisher wurden 262 Flugzeuge dieses Typs bestellt.Die erste Maschine wurde am 15. Oktober 2007 in Toulouse an die Fluggesellschaft Singapore Airlines übergeben und hatte am 25. Oktober 2007 ihren ersten Passagierflug.', 276800, 525, 945, 15000, '13000', 8, 98, 'H', '/images/aircraft/A380.jpg', 'Airbus'),
