(253, 49, 'B733', NULL, '737-300', 'Die Boeing 737-300 ist ein zweistrahliges Kurz- und Mittelstrecken Verkehrsflugzeug für max. 140 Passagiere.', 32900, 140, 933, 5463, '11200', NULL, NULL, 'M', '/images/aircraft/737-800.jpg', 'Boeing Company'),
(254, 49, 'B734', NULL, '737-400', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'M', NULL, 'Boeing Company'),
(255, 49, 'B735', NULL, '737-500', 'Die Boeing 737-500 ist eine verkürzte Version mit der Länge der Boeing 737-200, aber der modernen Technik der -300 und -400.\r\nEs wird für Kurz - und Mittelstrecken eingesetzt', 31000, 120, 946, 5500, '11000', NULL, NULL, 'M', '/images/aircraft/737-500.jpg', 'Boeing Company'),
(256, 49, 'B736', NULL, '737-600', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'M', NULL, 'Boeing Company'),
(257, 49, 'B737', NULL, 'C-40 Clipper', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'M', NULL, 'Boeing Company'),
(258, 49, 'B737', NULL, '737-700', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'M', NULL, 'Boeing Company'),
(259, 49, 'B738', NULL, '737-800', 'Die Boeing 737-800 ist ein zweistrahliges Kurz- Mittelstrecken Verkehrsflugzeug.\r\nDer Erstflug erfolgte am 31. Juli 1997, im April 1998 wurde das erste Flugzeug der Hapag-Lloyd Flug (heute TUIfly) übergeben. Von Hapag-Lloyd stammte auch die Forderung nach einer Reichweitenerhöhung. Die Fluggesellschaft forderte im Pflichtenheft, die Strecke Hannover–Kanaren vollbesetzt ohne Tankstopp fliegen zu können. Für VARIG wurde die Variante SFP (short-field performance) entwickelt, um auf der nur 1350 Meter kurzen Piste des Flughafens Rio de Janeiro-Santos Dumont starten zu können.', 41413, 186, 946, 7500, '12500', NULL, NULL, 'M', '/images/aircraft/737-800.jpg', 'Boeing Company'),
(260, 49, 'B739', NULL, '737-900', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'M', NULL, 'Boeing Company'),
(261, 49, 'B741', NULL, '747-100', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Boeing Company'),
(262, 49, 'B742', NULL, 'E-4 / VC-25', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Boeing Company'),
(263, 49, 'B742', NULL, '747-200', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Boeing Company'),
(264, 49, 'B743', NULL, '747-300', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Boeing Company'),
(265, 49, 'B744', NULL, '747-400', 'Die 747-400-Serie erreichte mit ihren verschiedenen Untervarianten eine Zahl von insgesamt ca. 700 Bestellungen (Stand November 2006). Sie ist damit die meistgebaute Variante der Boeing 747. Bis zur Aufnahme des regulären Betriebs des Airbus A380 war die 747-400 das größte Passagierflugzeug der Welt. Sie wurde von der 747-8 ersetzt, deren Erstflug 2010 stattfand.', 184567, 352, 982, 13449, '13747', 8, 66, 'H', '/images/aircraft/747-400.jpg', 'Boeing Company'),
(266, 49, 'B74R', NULL, '747SR', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Boeing Company'),
(267, 49, 'B74S', NULL, '747SP', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Boeing Company'),
(268, 49, 'B752', NULL, 'C-32', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'M', NULL, 'Boeing Company'),
(269, 49, 'B752', NULL, '757-200', 'Basisversion, deren Produktion Boeing im März 1979 bekannt gab, nachdem Kaufverträge mit British Airways und Eastern Airlines über 40 (19/21) Maschinen abgeschlossen worden waren. Der Erstflug fand am 19. Februar 1982 statt, und schon am 22. Dezember 1982 wurde die erste Maschine an die Eastern Airlines ausgeliefert.\r\nDie Boeing 757-200 ist ein zweistrahliges Düsenflugzeug mit einem zentralen Gang, gefertigt vom amerikanischen Luft- und Raumfahrtunternehmen Boeing. Sie ist vorgesehen für Mittelstreckenflüge. In den 1980ern wurde sie als Nachfolger der sehr erfolgreichen Boeing 727 konzipiert; seitdem wurden über 1000 Stück gefertigt.', 59350, 144, 914, 7000, '12800', NULL, 16, 'M', '/images/aircraft/757-200.jpg', 'Boeing Company'),
(270, 49, 'B753', NULL, '757-300', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'M', NULL, 'Boeing Company'),
(271, 49, 'B762', NULL, '767-200', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Boeing Company'),
(272, 49, 'B763', NULL, '767-300', 'Die Boeing 767-300 ist ein mittelgroßeszweistrahliges Düsenflugzeug mit zwei Gängen, gefertigt von Boeing, dem amerikanischen Unternehmen für Luft- und Raumfahrt.  Sie war das erste zweistrahlige von Boeing gefertigte Flugzeug mit breitem Rumpf und wurde anfangs gleichzeitig mit der Boeing 757 entwickelt. Sowohl die 767 als auch 757 haben in Bezug auf ihr Design viele Merkmale gemeinsam; dies ermöglicht Piloten, beiden Modellen gemeinsam geschult zu werden, mit einem Minimum an Zusatzschulungen.', 88469, 252, 913, 11000, '13000', NULL, 15, 'H', '/images/aircraft/767-300.jpg', 'Boeing Company'),
(273, 49, 'B764', NULL, '767-400', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'H', NULL, 'Boeing Company'),
(274, 49, 'B772', NULL, '777-200', 'Die 777-200 ist das Basismodell der 777-Familie. Der Erstflug des Prototyps fand am 12. Juni 1994 statt. United Airlines war Erstkunde der Boeing 777 mit 34 Festbestellungen und ebenso vielen Kaufabsichtserklärungen.\r\nDie Boeing 777-200 ist ein zweistrahliges Mittel- und Langstrecken Grossraum- Verkehrsflugzeug.', 134800, 323, 950, 9695, '13000', NULL, 30, 'H', '/images/aircraft/777-200.jpg', 'Boeing Company'),
(275, 49, 'B773', NULL, '777-300', 'Die 777-300 war von 1997 bis 2002 mit 73,9 m Rumpflänge das längste Verkehrsflugzeug der Welt, ehe es vom Airbus A340-600 als solches abgelöst wurde. Die erste 777-300 flog im Oktober 1997 und im Mai 1998 nahm Cathay Pacific die erste 777-300 in Betrieb.\r\nDie Boeing 777-300 wird für Mittel- und Langstreckenflüge eingesetzt', 159570, 332, 950, 11000, '13000', 18, 49, 'H', '/images/aircraft/777-300.jpg', 'Boeing Company'),
