(1114, 187, 'MD88', NULL, 'MD-88', 'Die McDonnell Douglas MD-80 ist ein zweistrahliges Standardrumpfflugzeug des US-amerikanischen Flugzeugherstellers McDonnell Douglas. Dieses Kurz- und Mittelstreckenflugzeug ist mit 1.191 verkauften Exemplaren der erfolgreichste Jet von McDonnell Douglas. Seinen Erstflug absolvierte das Flugzeugmuster in der Version MD-81 am 26. Juni 1979.\r\n Die MD-88 ist eine Weiterentwicklung der erfolgreichen MD-82 auf Wunsch von Delta Air Lines, welche die erste Maschine im Dezember 1987 erhielt. Der Hauptunterschied besteht im moderneren Cockpit der MD-88.', 35369, 172, 924, 3800, '11200', NULL, 20, 'M', '/images/aircraft/MD-88.jpg', 'McDonnell Douglas Corporation'),
(1115, 187, 'MD90', NULL, 'MD-90', 'Die McDonnell Douglas MD-90 ist ein von 1993 bis 2000 gebautes zweistrahliges Standardrumpfflugzeug für Kurz- und Mittelstrecken des US-amerikanischen Flugzeugherstellers McDonnell Douglas.', 40000, 172, 900, 3800, '11200', 16, NULL, 'M', '/images/aircraft/MD-90.jpg', 'McDonnell Douglas Corporation'),
