(1324, 220, 'PC12', NULL, 'PC-12', 'Die Pilatus PC-12 ist ein einmotoriges Turboprop-Mehrzweckflugzeug des schweizerischen Flugzeugherstellers Pilatus Aircraft. Es stellt den Versuch des Unternehmens dar, ein einzelnes leistungsstarkes Turboprop-Triebwerk mit einer geräumigen Zelle zu verbinden. Es eignet sich für ein weitgefächertes Einsatzspektrum. Im Juli 2010 lieferte Pilatus das tausendste Exemplar aus, weitere 200 sind bestellt.', 2974, 9, 519, 4000, '9000', NULL, NULL, 'L', '/images/aircraft/PC-12.jpg', 'Pilatus'),
(1325, 220, 'PC21', NULL, 'PC-21', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'L', NULL, 'Pilatus'),
(1326, 220, 'PC6P', NULL, 'PC-6 Porter', 'Pilatus PC-6 ist die Bezeichnung für ein einmotoriges STOL-Flugzeug des Schweizer Herstellers Pilatus Aircraft. Es existieren mit dem Pilatus Porter (PC-6 mit Kolbenmotor) und dem Pilatus Turbo-Porter (PC-6/A bis PC-6/C mit Propellerturbine) zwei unterschiedlich angetriebene Ausführungen. Bei dem universell einsetzbaren Arbeitsflugzeug können alternativ zum Radfahrwerk auch Kufen oder Schwimmer installiert werden. Die vielseitigen Einsatzmöglichkeiten werden zusätzlich durch die leichte Umrüstbarkeit vom Passagier- zum Frachttransport ergänzt. Die PC-6 wird in unterschiedlichen Rollen als Sanitätsflugzeug (mit zwei Tragen und fünf Sitzen, einschließlich der Crew), in der Luftbildfotografie, für den Abwurf von Versorgungsgütern, zum Absetzen von Fallschirmspringern und für Sprüheinsätze in der Landwirtschaft eingesetzt.', 1110, 10, 233, 1200, '6600', NULL, NULL, 'L', '/images/aircraft/PC-6-Porter.jpg', 'Pilatus'),
(1327, 220, 'PC6T', NULL, 'PC-6A/B/C Turbo-Porter', 'Pilatus PC-6 ist die Bezeichnung für ein einmotoriges STOL-Flugzeug des Schweizer Herstellers Pilatus Aircraft. Es existieren mit dem Pilatus Porter (PC-6 mit Kolbenmotor) und dem Pilatus Turbo-Porter (PC-6/A bis PC-6/C mit Propellerturbine) zwei unterschiedlich angetriebene Ausführungen. Bei dem universell einsetzbaren Arbeitsflugzeug können alternativ zum Radfahrwerk auch Kufen oder Schwimmer installiert werden. Die vielseitigen Einsatzmöglichkeiten werden zusätzlich durch die leichte Umrüstbarkeit vom Passagier- zum Frachttransport ergänzt. Die PC-6 wird in unterschiedlichen Rollen als Sanitätsflugzeug (mit zwei Tragen und fünf Sitzen, einschließlich der Crew), in der Luftbildfotografie, für den Abwurf von Versorgungsgütern, zum Absetzen von Fallschirmspringern und für Sprüheinsätze in der Landwirtschaft eingesetzt.', 1020, 10, 280, 1000, '8500', NULL, NULL, 'L', '/images/aircraft/PC-6-Turbo.jpg', 'Pilatus'),
