(15, 232, 'Airbus', 'Rond-point de la Crabe', 31300, 'Toulouse', '+33 5 61 93 1000', 'www.airbus.com', 'media@airbus.com', 'Airbus S. A. S. ist eine Tochtergesellschaft der EADS, der größte europäische und weltweit zweitgrößte Flugzeughersteller. Sein Hauptsitz befindet sich in Toulouse. Montagewerke stehen in Frankreich, Deutschland, Spanien und Großbritannien. Airbus erzielte im Jahr 2010 einen Umsatz von 27,6 Milliarden Euro, im Jahr 2011 33,1 Milliarden Euro (EBIT 1,8 %) und beschäftigt derzeit rund 69.300 Mitarbeiter (Quelle: Handelsblatt vom 31. Mai 2012). Neben dem US-amerikanischen Unternehmen Boeing ist Airbus einer der größten Hersteller für Passagierflugzeuge weltweit. Zusammen bilden die beiden Unternehmen derzeit das Duopol für Großraumflugzeuge.\r\n\r\nIm April 2009 wurde „Airbus Military“ gegründet. Unter diesem Dach sind alle zum Airbus-Konzern gehörigen militärischen Luftfahrzeug-Programme gebündelt. Airbus Military hat ihren Sitz in der spanischen Hauptstadt Madrid.\r\n\r\nEine weitere Tochtergesellschaft ist die Airbus Transport International, die 1996 gegründet wurde und die fünf Airbus-Beluga-Großraumtransportflugzeuge betreibt. Diese Flugzeuge werden für die airbusinterne Logistik (Transport von vormontierten Bauteilen wie Rumpfsektionen und Tragflächen zwischen den Produktionsstandorten), wie auch für Charterflüge verwendet.', '/images/aircraft_manufacturer/Airbus.jpg', 'International'),
