(49, 222, 'Boeing Company', '100 North Riverside ', 60606, 'Chicago,Illinois', '312-544-2140', 'www.boeing.com', NULL, 'Mit dem Beginn des Kalten Krieges konnte Boeing die führende Position in dieser Sparte mit der B-47 und B-52 weiter festigen. Weil die Reichweite dieser Bomber für einen Angriff auf die Sowjetunion nicht ausreichte, entwickelte Boeing für die United States Air Force auch das jetgetriebene Tankflugzeug KC-135, das von Boeing zur 707 weiterentwickelt wurde und so Boeings Aufstieg zum größten Produzenten von Zivilflugzeugen einleitete. Während Boeing mit Zivilflugzeugen immer erfolgreicher wurde, ging der Erfolg bei der Ausschreibung neuer Bomberprojekte zurück. In den 1950er Jahren betrat Boeing mit der Entwicklung der ballistischen Interkontinentalrakete Minuteman technisches Neuland. Darauf aufbauend konnte der Konzern in der Raumfahrt erfolgreich Fuß fassen: Boeing produzierte unter anderem die erste Stufe der Mondrakete Saturn V. 1997 übernahm Boeing den in der zivilen Luftfahrt zur Nummer drei (hinter Airbus) abgesunkenen Flugzeugbauer McDonnell Douglas und die Aerospace Units von Rockwell International (Boeing North American).', '/images/aircraft_manufacturer/Boeing.jpg', 'Vereinigte Staaten'),
(50, 222, 'Boeing Vertol / Boeing Helicopters', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Vereinigte Staaten'),
