(53, 92, 'Bombardier Aerospace', '800 René-Lévesque Blvd. West', NULL, 'Montréal', '+1 514 861 9481', 'www.aerospace.bombardier.com', NULL, 'Der Flugzeughersteller Bombardier Aerospace ist eine Abteilung der kanadischen Bombardier Inc. und ein Hersteller von Business- und Regionaljets. Neben der Herstellung von Flugzeugen bietet Bombardier Aerospace auch Flugzeugcharter, Service und Wartung von Flugzeugen und die Ausbildung von Piloten für den Business- und Regionalflugverkehr sowie für militärische Kunden. Bombardier Aerospace ist nach Boeing und Airbus der drittgrößte Flugzeughersteller weltweit. Bombardier verfügt über Werke in Kanada, USA, Großbritannien und Mexiko. Desweiterhin verfügt das Unternehmen über ein weltweites Technik und Supportnetzwerk.', '/images/aircraft_manufacturer/Bombardier.jpg', 'Kanada'),
