(96, 30, 'EMBRAER, Empresa Brasileira de Aeronautica, S. A.', 'de Aeronautica SA Caixa Postal 343', 12225, 'São José dos Campos', '(+55 12) 3927-1000', 'www.embraer.com', NULL, 'Die Empresa Brasileira de Aeronáutica S.A. mit Sitz in São José dos Campos (Brasilien) in der Nähe von São Paulo ist nach Boeing, Airbus und Bombardier Aerospace der viertgrößte Flugzeugbauer der Welt. Embraer produziert sowohl für den zivilen als auch den militärischen Sektor. Neben dem Hauptsitz unterhält Embraer Büros und Servicestützpunkte in Australien, der Volksrepublik China, Frankreich, Portugal, Singapur und den USA. Das Unternehmen ist einer der größten Exporteure Brasiliens und hat zurzeit weltweit 16.853 Beschäftigte, von denen 94,7 Prozent in Brasilien tätig sind.', '/images/aircraft_manufacturer/Embraer.jpg', 'Brasilien'),
