(220, 179, 'Pilatus', NULL, 6371, 'Stans', '+41 41 619 62 26', 'www.pilatus-aircraft.com', 'nfo@pilatus-aircraft.com', 'Die 1939 gegründete Pilatus Flugzeugwerke AG ist heute weltweit führende Herstellerin von einmotorigen Turboprop-Flugzeugen und die einzige Schweizer Firma, welche Flugzeuge und Trainingssysteme entwickelt, baut und auf allen Kontinenten verkauft. Die Firma mit Hauptsitz in Stans ist zudem lizenziert, verschiedene Flugzeugtypen zu warten und umzubauen. Drei selbstständige Tochtergesellschaften in Altenrhein, Broomfield (Colorado, USA) und Adelaide (Australien) gehören zur Pilatus Gruppe. Mit fast 1300 Mitarbeitenden am Hauptsitz ist Pilatus einer der grössten Arbeitgeber in der Zentralschweiz. Pilatus bildet 100 Lernende in zehn verschiedenen Lehrberufen aus – die Förderung von jungen Berufsleuten hat bei Pilatus einen sehr hohen Stellenwert.', '/images/aircraft_manufacturer/Pilatus.jpg', 'Schweiz'),
