(11, 'JP', 188, 'ADR', 'Adria Airways', 'ADRIA', 'Zgornji Brnik 130h', 4210, 'Brnik', ' +41 (0)44 212 63 93', 'http://www.adria.si', 'adria.slo@bluewin.ch', 'images/airline/jp.jpg', 'Die Geschichte von Adria Airways hat ihren Ursprung im Jahre 1961, als sie als Chartergesellschaft gegründet wurde. In den 1980er Jahren nahm die Fluglinie den Liniendienst auf und wurde Mitglied der IATA, der International Air Transport Association.\r\n\r\nHeute bildet der Linienverkehr das Hauptgeschäft von Adria Airways; das Netzwerk verbindet Ljubljana mit 18 Europäischen Städten und bietet exzellente Verbindungen in den Südosten Europas. Adria Airways bietet mehr als 170 wöchentliche Linienflüge nach Amsterdam, Barcelona, Belgrad, Brüssel, Kopenhagen, Frankfurt, London, Istanbul, Manchester, Moskau, München, Podgorica, Pristina, Sarajevo, Skopje, Tirana, Wien und Zürich. Linienflüge zwischen Pristina und deutschen Städten (Frankfurt, München) sind seit Dezember 2010 im Flugplan und seit Jänner 2012 fliegt Adria Airways zweimal wöchentlich zwischen Pristina und Verona.\r\n\r\nDie Unternehmenszentrale befindet sich am Jože Pu?nik Flughafen Ljubljana und hat Repräsentanzen in Ljubljana, am Jože Pu?nik Flughafen Ljubljana, Brüssel, Moskau, Frankfurt, Zagreb und Zürich sowie Verkaufsagenten in fast allen Europäischen Ländern.\r\n\r\nIm August 2004 war Adria Airways eine der ersten Fluglinien, die eine IOSA (IATA Operational Safety Audit) Registrierung erhalten hat, welche den Organisationsgrad, die operationellen Verfahren, sowie die Flugsicherheit des Unternehmens festlegt.\r\n\r\nIm Jänner 2010 wurde Adria Airways ein Vollmitglied von Star Alliance. In Verbindung mit ihren Partnern bietet sie Zugang zu einem globalen Flugnetz von 27 Fluglinien, welche täglich mehr als 21.000 Flüge zu 1.356 Flughäfen in 193 Ländern anbieten.\r\n\r\nIn ihrer 50-jährigen Geschichte hat Adria Airways eine große Menge an Hightech-Wissen angesammelt, welches erhalten und ständig weiter ausgebaut wird. Das Fachwissen unserer hochqualifizierten Mitarbeiter in den Bereichen Ground Operations, Wartung, Kabinen- und Cockpitbesatzung wird seit vielen Jahren ausländischen Airlines zu Schulungszwecken vertraglich zur Verfügung gestellt. Adria Airways Piloten haben im Auftrag von Airbus Industry A320 Piloten überall auf der Welt ausgebildet. Unsere Mitarbeiter sind stolz auf ihre reichhaltige Erfahrung in einem multiethischen und multikulturellen Umfeld.', 'Slowenien'),
