(64, 'AB', 43, 'BER', 'Air Berlin', 'AIR BERLIN', 'Saatwinkler Damm 42-43', 13627, 'Berlin', '+41 (0)848 737 800', 'http://www.airberlin.com ', 'serviceteam@airberlin.com ', 'images/airplane/ab.jpg', 'Airberlin ist eine nationale und internationale Fluggesellschaft und seit 1997 Mitglied der International Air Transport Association (IATA). Seit Anfang 2011 gehört airberlin auch der Association of European Airlines (AEA) als deren 37. Mitglied an.\r\n\r\nDie airberlin group ist mit 9.300 Mitarbeitern, einer Flotte von 158 Flugzeugen und 35,3 Millionen Fluggästen die zweitgrößte Fluggesellschaft in Deutschland. Im Europa-Verkehr liegt die airberlin group gemessen an der Anzahl der Flugreisenden an sechster Stelle. airberlin gehört zu den führenden Fluggesellschaften in Europa. Ihre Marktposition hat das Unternehmen mit stetig wachsendem Flugangebot, technischen Innovationen und neuen Produkten ausgebaut. Zur airberlin group gehören neben airberlin auch die österreichische Airline NIKI (mit 49,9 Prozent), die Schweizer Fluggesellschaft Belair (49 Prozent) und die airberlin technik GmbH (100 Prozent).\r\n\r\nAnfang 2004 übernahm airberlin 24 Prozent an der NIKI Luftfahrt GmbH. Im Februar 2010 hat airberlin ihren Anteil an NIKI auf 49,9 Prozent erhöht. Die von dem österreichischen Formel-1-Weltmeister Niki Lauda gegründete Airline stärkt sowohl die Marktpräsenz der airberlin group in Österreich als auch das airberlin Drehkreuz in Wien als Tor nach Osteuropa. Im November 2007 erwarb airberlin eine 49-prozentige Beteiligung an Belair Airlines. Die Schweizer Fluggesellschaft hat ihren Heimatflughafen in Zürich und fliegt im Auftrag der airberlin group Destinationen im Mittelmeerraum, in Ägypten, auf den Kanarischen Inseln und in Deutschland an. Die airberlin technik GmbH (ABT) ist der luftfahrttechnische Betrieb innerhalb der airberlin group und Hauptanbieter von Wartungsleistungen für die Flugzeuge der Unternehmensgruppe. Die Gesellschaft wurde am 1. April 2011 durch die Zusammenführung der airberlin Luftfahrttechniken Berlin, Düsseldorf und Köln gegründet und ist eine hundertprozentige Tochter der Air Berlin PLC & Co. Luftverkehrs KG.\r\n\r\nDie Air Berlin PLC ist die juristische Obergesellschaft der airberlin group und wurde 2005 als Aktiengesellschaft nach britischem Vorbild in England und Wales gegründet. Der Sitz des Managements ist in Deutschlands Hauptstadt Berlin. ', 'Deutschland'),
