(188, 'AA', 222, 'AAL', 'American Airlines', 'AMERICAN', 'PO Box 6196161', 75261, 'Dallas-FH Texas', '1 (0)817 967 12343', 'http://www.americanairlines.ch', 'webmaster@aa.com', 'images/airline/aa.jpg', 'American, American Eagle und AmericanConnection® bedienen gemeinsam 250 Städte in über 40 Ländern der Welt, mit mehr als 3.400 täglichen Flügen. American Airlines bietet bis zu 37 tägliche Non-Stop Flüge von Europa in die USA. Die Flotte umfasst fast 900 Flugzeuge. American Airlines ist Gründungsmitglied der oneworld® Allianz, die einige der besten und größten Namen der Airlinebranche unter ihrem Dach vereint und somit ihren Kunden höchste Servicequalität und Leistung bieten kann. Zusammen bedienen die Allianzmitglieder über 750 Destinationen in mehr als 150 Ländern.\r\n\r\nUnser Erfolg gründet auf unserem ausgedehnten Streckennetz und unseren häufigen Flügen. Von Zürich fliegt American Airlines täglich non-stop nach New York mit Anschluss zu mehr als 250 Destinationen in Nord-, Mittel- und Südamerika.\r\n\r\nZusätzlich zu diesem Non-Stop-Service ab Zürich fliegt American Airlines täglich von Paris, Brüssel, Frankfurt, Mailand, Rom, Madrid, Barcelona, London Heathrow, Manchester, Dublin, Helsinki und Budapest zu sieben amerikanischen Gateways (New York, Boston, Chicago, Los Angeles, Raleigh Durham, Miami und Dallas/Forth Worth) mit Anschluss zu Destinationen in den USA sowie Kanada, Lateinamerika, der Karibik, Japan, China und Indien.\r\n\r\nUnseren europäischen Flugplan und eine interaktive Transatlantikroutenkarte finden Sie auf unserer Website.\r\n\r\nAmerican Airlines ist seit mehr als 75 Jahren eine weltweit führende Fluggesellschaft. Fliegen Sie mit uns und entdecken Sie American Airlines Qualität.\r\n85 Jahre Geschichte\r\n\r\nAm 15. April 1926 flog Charles Lindbergh, Chefpilot der Robertson Aircraft Corporation, einen Sack Post in einem DH-4 Doppeldecker von Chicago nach St. Louis. Dieser Flug gilt als der erste planmäßige Flug der American Airlines. Heute fliegen wir unsere Passagiere zu über 250 Destinationen in Nord-, Mittel- und Südamerika und benötigen dafür eine große Flotte. Mit fast 85 Jahren Erfahrung befördern wir jährlich insgesamt circa 94 Millionen Fluggäste.\r\nErfahren Sie mehr über die Geschichte von American Airlines. ', 'Vereinigte Staaten'),
