(867, 'LX', 179, 'SWR', 'Swiss International Air Lines', 'SWISS', 'Flughafen Kloten', 8058, 'Zürich-Flughafen', '+ 41 (0)848 85 2000', 'http://www.swiss.com', 'contactus@swiss.com', 'images/airline/lx.jpg', 'Swiss International Air Lines bedient ab ihrem Hub Zürich und den Landesflughäfen Basel und Genf weltweit 69 Destinationen (Winterflugplan 2012/13) in 37 Ländern. Die Flotte umfasst 90 Flugzeuge.\r\n\r\nSWISS ist die nationale Fluggesellschaft der Schweiz und steht für deren traditionelle Werte ein. Auf Grund ihrer Herkunft verpflichtet sie sich zu höchster Produkt- und Servicequalität. Ihre überschaubare Grösse ermöglicht es SWISS, näher an ihren Gästen zu sein und sie individueller zu betreuen.\r\n\r\nSWISS engagiert sich auf verschiedenen Ebenen nachhaltig für den sorgsamen Umgang mit Ressourcen und sieht verantwortungsvolles Handeln gegenüber der Umwelt als Bestandteil ihrer Unternehmenskultur. Als Teil des Lufthansa-Konzerns und als Mitglied der Star Alliance hält SWISS an ihrer Mission fest, als Qualitätsairline die Schweiz mit Europa und der Welt zu verbinden.', 'Schweiz'),
