(3832, 'FRA', 43, 'EDDF', 'Frankfurt am Main', 'Der Flughafen Frankfurt am Main ist der mit Abstand größte deutsche Verkehrsflughafen und zugleich eines der weltweit bedeutendsten Luftfahrtdrehkreuze. Gemessen am Passagieraufkommen ist er nach London-Heathrow und Paris-Charles de Gaulle der drittgrößte Flughafen in Europa und liegt im weltweiten Vergleich auf dem neunten Rang.\r\nIm Jahr 2011 wurden in Frankfurt insgesamt 56,4 Millionen Passagiere gezählt. Mit ca. 2,2 Millionen Tonnen hat der Frankfurter Flughafen das größte Frachtaufkommen aller europäischen Flughäfen und das siebthöchste weltweit. Der Flughafen ist die Heimatbasis der Fluggesellschaften Lufthansa, Condor Flugdienst, XL Airways Germany, SunExpress Deutschland, sowie der Frachtfluggesellschaften Lufthansa Cargo und Nightexpress.\r\n\r\nBetreibergesellschaft ist die Fraport AG. Als Frankfurt-Flughafen mit rund 200 Einwohnern ist das Flughafengelände ein eigenständiger Stadtteil von Frankfurt am Main. Der südliche Teil des Flughafengeländes liegt teilweise auf dem Gebiet der Stadt Rüsselsheim (Kreis Groß-Gerau).', 'Frankfurt', 'Deutschland', 'images/airport/fra.jpg', NULL),
