(4571, 'FCO', 84, 'LIRF', 'Fiumicino (Leonardo Da Vinci Intl Airport)', 'Der Flughafen Rom-Fiumicino ist der größte Flughafen der italienischen Hauptstadt Rom und das Hauptdrehkreuz der Fluggesellschaft Alitalia. Der nach Leonardo da Vinci benannte Flughafen befindet sich an der Mittelmeerküste, 34 km westlich der römischen Innenstadt. Mit ca. 37 Millionen Passagieren im Jahr 2011 ist er der größte Flughafen Italiens, der siebtgrößte in Europa und steht an 28. Stelle der größten Flughäfen weltweit.', 'Rome', 'Italien', 'images/airport/fco.jpg', NULL),
