(4654, 'HND', 86, 'RJTT', 'Tokyo Intl Airport (Haneda)', 'Der Flughafen Tokio Haneda ist ein internationaler Flughafen in Tokio und gilt nach der japanischen Gesetzgebung als Flughafen 1. Klasse. Er wird meist als Flughafen Haneda bezeichnet, was zugleich der Stadtteilname des Flughafens in Öta ist. 2010 wurde Haneda von 64 Millionen Fluggästen genutzt und gilt damit als der weltweit fünftgrößte Flughafen (nach Atlanta, Chicago-O’Hare, Peking und London-Heathrow).\r\nDer internationale Flugverkehr nach Tokio wird seit 1978 hauptsächlich über den Narita International Airport in Narita abgewickelt.', 'Tokyo', 'Japan', 'images/airport/hnd.jpg', NULL),
