(6233, 'BRN', 179, 'LSZB', 'Bern - Belp', 'Der Regionalflugplatz Bern-Belp ist der Flugplatz der schweizerischen Bundesstadt Bern und die Heimatbasis der Sky Work Airlines. Er wird von der privatwirtschaftlichen ALPAR Flug- und Flugplatzgesellschaft AG betrieben, die ihn entgegen seiner Klassifizierung als Flughafen bezeichnet. Der Flughafen liegt 6 km südöstlich von Bern auf dem Gebiet der Gemeinde Belp. Die Zufahrt für den privaten Verkehr erfolgt über die Autobahnausfahrt A6 Rubigen. Er ist mit dem öffentlichen Verkehr erreichbar: im Halbstundentakt fährt der Airport Bus Bern zum Bahnhof Belp, von wo die S-Bahnlinien S3, S4, S31 und S44 zum Bahnhof Bern verkehren. Die Reisezeit zwischen dem Flughafen und dem Bahnhof Bern beträgt 29 Minuten. Der Regionalbus Tangento verbindet den Flughafen Bern-Belp mit den umliegenden Gemeinden Konolfingen, Tägertschi, Münsingen, Rubigen und Belp.[2] Zudem stehen gebührenpflichtige Parkplätze im Freien zur Verfügung.', 'Bern', 'Schweiz', 'images/airport/brn.jpg', NULL),
(6234, 'GVA', 179, 'LSGG', 'Geneva - Cointrin', 'Der Aéroport International de Genève in der politischen Gemeinde Le Grand-Saconnex und Cointrin in Meyrin ist der internationale Verkehrsflughafen von Genf und der zweitgrösste Flughafen der Schweiz.\r\n\r\nDie wichtigsten Fluggesellschaften vor Ort sind die nationale schweizerische Fluggesellschaft Swiss und die Billigfluggesellschaft EasyJet, die am Flughafen ein Drehkreuz betreibt. Wichtigste Destinationen sind nach Passagieraufkommen London, Paris, Zürich, Amsterdam und Brüssel. Daneben ist der Flughafen Genf ein wichtiger Standort der VIP-Fliegerei und profitiert von den zahlreichen in Genf ansässigen internationalen Organisationen, darunter die Vereinten Nationen und das Internationalen Rotkreuz- und Rothalbmond-Bewegung.\r\nUnmittelbar südöstlich an den Flughafen angrenzend befindet sich das Genfer Messegelände Palexpo, in dem u. a. der Genfer Auto-Salon stattfindet. Der Flughafen hat einen unterirdischen Bahnhof, der Zugsverbindungen ins Genfer Stadtzentrum als auch nach den wichtigsten Schweizer Städten anbietet.', 'Geneva', 'Schweiz', 'images/airport/gva.jpg', NULL),
(6235, 'LUG', 179, 'LSZA', 'Lugano Airport', 'Der Flughafen Lugano-Agno (offiziell Lugano Airport) ist ein internationaler Schweizer Flughafen im Tessin. Namensgeber ist die Gemeinde Agno, ein Vorort der Stadt Lugano.\r\nDie meisten Flüge in Lugano-Agno werden mit Saab 2000 der Darwin Airline operiert: Die Flüge nach Rom im Code-Share mit Alitalia, Ziele im Mittelmeerraum wie Cagliari und Olbia werden als Saisondestinationen während des Sommers bedient, der wichtigste Flug (nach Zürich-Kloten) wird im Auftrag von SWISS International Airlines als Wet-Lease geflogen. Für den Sommerflugplan 2012 hat Sky Work Airlines die Wiederaufnahme der Verbindung nach Bern angekündigt, damit erhält der Flughafen Lugano neu Zugang zu 24 internationalen Destinationen. Darwin Airline hatte die Relation bis 2007 bedient und danach eingestellt.', 'Lugano', 'Schweiz', 'images/airport/lug.jpg', NULL),
(6236, 'SMV', 179, 'LSZS', 'Samedan Airport', 'Der Engadin Airport (auch Flugplatz Samedan) ist mit 1''707 m ü. M. der höchstgelegene Flughafen Europas. Er befindet sich nahe dem Engadiner Dorf Samedan, rund fünf Kilometer entfernt vom mondänen Schweizer Touristenort St. Moritz.\r\nEinen regelmässigen Linienbetrieb kennt der Flugplatz nicht mehr, jedoch wird er vor allem im Winter von verschiedensten Privatjet-Anbietern angeflogen. Es herrscht reger Segelflugverkehr. Beliebt ist der Flugplatz auch bei Fallschirmspringern und ähnlichen Sportarten, die von hier aus in die Berninagruppe starten. Auf dem Gelände befindet sich auch eine Flugschule.\r\nDer Flughafen ist ganzjährig tagsüber geöffnet und hat eine Zollabfertigung sowie einen Hangar. Jedoch ist die Piste nicht immer schneefrei. Sie ist aber lang genug, dass auch schon Grossflugzeuge wie Boeing 737 und Super Constellation dort landeten. Jährlich finden auf dem Flughafen rund 20''000-22''000 Flugbewegungen statt.\r\n\r\nUm einen Mangel an Flugzeug-Abstellflächen zu beheben, ist eine erhebliche Erweiterung des Vorfelds geplant.\r\n\r\nDer Flughafen verfügt über kein Instrumentenlandesystem, so dass die Landung nur auf Sicht erfolgen kann. In Verbindung mit der Lage in einem engen Bergtal, der ausserordentlichen Höhe über Meer und schwierigen Windverhältnissen gilt die Landung als besonders anspruchsvoll.[2]\r\n\r\nIn der Folge des Unfalls vom 19. Dezember 2010 erliess das Schweizer Bundesamt für Zivilluftfahrt neue strengere Richtlinien für Piloten vor und beim Anflug des Flughafens. Unmittelbar nach dem Unfall wurde für Piloten ein elektronisches Briefing verpflichtend, das vor dem Abflug zum Flughafen Engadin wichtige Grundkenntnisse über die Besonderheiten des Flughafens abfragt. Anfang 2011 wird die Verpflichtung eingeführt, dass alle Piloten, die den Flughafen noch nicht beflogen haben, ihren Erstanflug als Einweisungsflug in Begleitung eines Fluglehrers absolvieren müssen, bevor sie die Erlaubnis zum Anflug im Alleinflug erhalten. Die Limits für den Sichtflug wurden angehoben, so dass ein Anflug nur noch bei einer Mindestsicht von 5 Kilometern und einer Wolkenhöhe von mindestens 700 Metern über Grund erfolgen darf.[4]\r\n', 'Samedan', 'Schweiz', 'images/airport/smv.jpg', NULL),
(6237, 'SIR', 179, 'LSGS', 'Sion Airport', NULL, 'Sion', 'Schweiz', 'images/airport/sir.jpg', NULL),
(6238, 'ACH', 179, 'LSZR', 'St Gallen - Altenrhein', 'Professor Claude Dornier entschied sich Flugboot DO-X im Alten Rhein zu bauen und gründete St. Gallen-Altenrhein Flughafen im Jahr 1926.\r\n\r\nErweiterungen:\r\nIm Jahr 1927 die erste 600m lange Graspiste wurde gebaut und verwendet bis zum Zweiten Weltkrieg für Linienflüge fliegen nach Basel, Dübendorf, Innsbruck und München.\r\n\r\nIm Laufe der Zeit mit neuen Erweiterungen am Flughafen, Altenrhein wurde eine zentrale europäische Flugplatz für Land und Meer Ebenen. Im Jahre 1954 rief ein Kämpfer Flugzeugschlepp FFA auf 1200m lange und 30m breite Start-und Landebahn mit Hilfe des Bundes errichtet wurde. Im Jahr 1979 wurde die Landebahn auf 1500m, die ihre aktuelle Länge ausgezogen ist. Der Flughafen wurde verlängert, weil bis 1933 der Bundesregierung gab Auftrag für ein Jagdflugzeug Hunter Flugzeugschlepp\r\n\r\nWartung:\r\nNach einiger Zeit war es offensichtlich, dass der Flughafen hat begonnen, seine Bedeutung für den Bau von Militärflugzeugen zu verlieren. Deshalb ist die Wartung hat für zivile Flugzeugschlepp arrangiert worden.\r\nTägliche Linienflüge nach Wien begann Ende der 80er Jahre durch den Seewald GmbH Rheintalflug vom Flughafen, die von den Alten Rhein gesetzt wurde. Und bis zum Jahr 1988 die Konzession für Flughafen bekam Linienflüge nach Wien.\r\n\r\nEine umfangreiche Ausbau der Infrastruktur:\r\nVon 1988 bis 1990 eine regualr Operation wurde sowohl für den Ausbau der Flugzeugwartung Bereich und auch eine bedeutende Erweiterung für die Infrastruktur des Flugplatzes benötigt. Es war, wenn die neue Hangars gebaut wurden und ein Instrument für eine Landung und einen Flughafen Gebäude installiert wurden. Tank Feuerwehrautos, Wetterstation, waren Skiddometer, Röntgen-Maschine für das Gepäck und einen Magnetverschluss für die Personenkontrolle anderen notwendigen Ausrüstungen, die neu zum Flughafen gebracht wurden. Im Jahr 1991 Rheintalflug Seewald GmbH beauftragt das Instrument der Landung mit dem Jungfernflug.\r\n\r\nWeitere Erweiterungen:\r\nBeginnend mit 2001 bis 2002 wurden einige andere weitere Investitionen wie neue Ankunftshalle, ein neues Feuerwehrhaus, eine moderne Gepäckförderanlage, große Parkflächen mit einem modernen Zahlungssystem und Business-Lounge mit Wireless Internet gemacht wurden.', 'St Gallen', 'Schweiz', 'images/airport/ach.jpg', NULL),
(6239, 'ZRH', 179, 'LSZH', 'Zürich Airport', 'Der Flughafen Zürich ist der grösste Flughafen der Schweiz. Er wird durch die börsenkotierte Flughafen Zürich AG betrieben.\r\n\r\n2009 wurde er von über acht Millionen Reisenden in der Skytrax-Umfrage zum besten Flughafen Europas gewählt; weltweit landete er auf dem vierten Platz. 2012 erhielt der Flughafen zum neunten Mal in Folge den World Travel Award in der Kategorie führender Flughafen Europas.\r\n\r\nDer Flughafenkopf liegt 13 Kilometer nördlich des Zentrums der Stadt Zürich auf dem Gemeindegebiet von Kloten, das Flughafenareal erstreckt sich darüber hinaus auf die Gemeinden Opfikon, Rümlang, Oberglatt und Winkel. Der Flughafen dient als Drehkreuz der Fluggesellschaften Swiss, Lufthansa, sowie Air Berlin und ist Heimatflughafen der Fluggesellschaften Swiss, Belair (Air Berlin), Edelweiss Air und Helvetic Airways, sowie Sitz der Schweizerischen Rettungsflugwacht (Rega).', 'Zürich', 'Schweiz', 'images/airport/zrh.jpg', NULL),
