(6332, 'MAD', 190, 'LEMD', 'Madrid Barajas Intl Airport', 'Der Flughafen Madrid-Barajas ist der internationale Flughafen der spanischen Hauptstadt Madrid. Er ist das größte und wichtigste Luftfahrt-Drehkreuz Spaniens, der fünftgrößte Verkehrsflughafen Europas (nach London-Heathrow, Paris-Charles de Gaulle, Frankfurt am Main und Amsterdam) sowie der fünfzehntgrößte Flughafen weltweit (Stand: 2011). Madrid-Barajas ist darüber hinaus der wichtigste europäische Knotenpunkt für Flüge nach Südamerika, Heimatflughafen der Fluggesellschaften Iberia, Air Europa und Air Pullmantur sowie Basis für Ryanair und easy Jet. Bis zu ihrer Insolvenz im Januar 2012 betrieb auch Spanair ein umfangreiches Streckennetz ab Madrid-Barajas.', 'Madrid', 'Spanien', 'images/airport/mad.jpg', NULL),
