(6678, 'ATL', 222, 'KATL', 'Hartsfield-Jackson Atlanta Intl Airport', 'Der Hartsfield–Jackson Atlanta International Airport ist der internationale Flughafen der Stadt Atlanta im US-Bundesstaat Georgia, USA. Flughafenbetreiber ist das Department of Aviation of the City of Atlanta (Stadtverwaltung Atlanta). Mit jährlich rund 89,3 Millionen Fluggästen (Stand 2010), die an 196 Gates abgefertigt werden, hat er das weltweit größte Passagieraufkommen. Dies führte zusammen mit gut 659.129 Tonnen Frachtgut zu 950.119 Starts und Landungen 2010 auf den derzeitigen fünf Start- und Landebahnen zwischen 2744 und 3644 m Länge.\r\n\r\nDie hohen Passagierzahlen ergeben sich daraus, dass Atlanta vorwiegend als Zwischenstop für weitere Inlandsflüge genutzt wird (etwa 57%). Als internationaler Flughafen rangiert er in den USA an siebter Position. Der Flughafen von Atlanta ist mit etwa 55.300 Angestellten der größte Arbeitgeber des Bundesstaates Georgia. Der jährliche Umsatz beträgt etwa 18,7 Milliarden US-Dollar.\r\nNur ein kleiner Bereich des Flughafens befindet sich auf dem Stadtgebiet von Atlanta, der größte Teil des Airports gehört zum benachbarten Clayton County.', 'Atlanta, Georgia', 'Vereinigte Staaten', 'images/airport/atl.jpg', NULL),
