(6899, 'JFK', 222, 'KJFK', 'John F. Kennedy Intl Airport', 'Der John F. Kennedy International Airport ist vor Newark und LaGuardia der größte Verkehrsflughafen im Raum New York City. 2011 wurden ca. 47,7 Millionen Passagiere befördert, damit ist JFK der sechstgrößte Flughafen der USA (nach Atlanta, Chicago-O’Hare, Los Angeles, Dallas/Fort Worth und Denver) und liegt im weltweiten Vergleich der Flughäfen auf Rang 17. Der von der Port Authority of New York and New Jersey betriebene Flughafen liegt 24 km östlich von Manhattan in Queens an der Jamaica Bay und dient als Drehkreuz für American Airlines, Delta Air Lines und JetBlue Airways.', 'New York, New York', 'Vereinigte Staaten', 'images/airport/jfk.jpg', NULL),
