(6959, 'SFO', 222, 'KSFO', 'San Francisco Intl Airport', 'Der San Francisco International Airport ist der internationale Verkehrsflughafen der kalifornischen Metropole San Francisco. Der durch die San Francisco Airports Commission betriebene Flughafen ist mit über 39 Millionen Passagieren im Jahr 2010 der neuntgrößte Flughafen der USA sowie nach dem Los Angeles International Airport der zweitgrößte an deren Westküste. Im weltweiten Vergleich liegt er auf Rang 23. SFO dient als Drehkreuz für United Airlines und Virgin America.', 'San Francisco, California', 'Vereinigte Staaten', 'images/airport/sfo.jpg', NULL),
